import React from "react";
import { Card, Button } from "react-bootstrap";

export default function SingleNote(props) {
  return (
    <div>
      <Card>
        <Card.Header>{props.note.title}</Card.Header>
        <Card.Body>
          {props.note.description}
          <Button variant="primary">More...</Button>
        </Card.Body>
      </Card>
    </div>
  );
}
